varying vec2 vUv;
uniform float iTime;
uniform vec3 iResolution;
uniform vec4 iMouse;

// --- Helper Functions ---

// Rotation matrix
mat2 rot(float a) {
    float s = sin(a);
    float c = cos(a);
    return mat2(c, -s, s, c);
}

// Color palette function
vec3 palette(float t) {
    vec3 a = vec3(0.5, 0.5, 0.5);
    vec3 b = vec3(0.5, 0.5, 0.5);
    vec3 c = vec3(1.0, 1.0, 1.0);
    vec3 d = vec3(0.263, 0.416, 0.557);
    return a + b * cos(6.28318 * (c * t + d));
}

// Signed Distance Function for a box
float sdBox(vec3 p, vec3 b) {
    vec3 q = abs(p) - b;
    return length(max(q, 0.0)) + min(max(q.x, max(q.y, q.z)), 0.0);
}

// Scene mapping function
float map(vec3 p) {
    // 1. Move the tunnel forward
    // Using iTime ensures smooth animation
    p.z += iTime * 0.8;

    // 2. Twist the space along Z for a vortex effect
    p.xy *= rot(p.z * 0.15);

    // 3. Infinite repetition (Modulo)
    // Divide space into segments of length 3.0
    float zCell = floor(p.z / 3.0);
    p.z = mod(p.z, 3.0) - 1.5;

    // 4. Fractal construction (KIFS - Kaleidoscopic Iterated Function System)
    float d = 1000.0;
    float s = 1.0;

    for(int i = 0; i < 4; i++) {
        // Fold space to create symmetry
        p = abs(p) - vec3(0.4, 0.4, 0.4) * s;

        // Rotate each iteration to create geometric complexity
        p.xy *= rot(1.1);
        p.xz *= rot(0.7);

        // Define a primitive (Box) at this scale
        float box = sdBox(p, vec3(0.2, 0.05, 0.2) * s);

        // Union the shape
        d = min(d, box);

        // Modify scale for next iteration
        s *= 0.8;
    }

    return d;
}

void main() {
    // Correct aspect ratio
    vec2 uv = (vUv * 2.0 - 1.0);
    uv.x *= iResolution.x / iResolution.y;

    // Camera setup
    vec3 ro = vec3(0.0, 0.0, -2.0); // Ray origin
    vec3 rd = normalize(vec3(uv, 1.5)); // Ray direction

    // Mouse interaction for camera rotation
    vec2 mouse = (iMouse.xy / iResolution.xy) * 2.0 - 1.0;
    rd.yz *= rot(mouse.y * 0.5);
    rd.xz *= rot(mouse.x * 0.5);

    // Raymarching variables
    float t = 0.0;        // Total distance traveled
    vec3 col = vec3(0.0); // Final color
    float d = 0.0;        // Current distance to scene

    // Volumetric Glow Accumulation
    // We accumulate color as we march, creating a glowing fog effect
    for(int i = 0; i < 80; i++) {
        vec3 p = ro + rd * t;
        d = map(p);

        // Accumulate glow based on proximity to geometry
        // Closer = brighter. 'exp' creates a sharp falloff.
        float glow = 0.015 / (0.01 + abs(d));

        // Vary color based on depth (t) and iteration (i)
        vec3 glowColor = palette(length(p.xy) * 0.5 + iTime * 0.2 + float(i)*0.01);

        col += glow * glowColor * 0.05; // Weight the accumulation

        // Advance ray
        t += max(d * 0.6, 0.02); // Prevent overstepping, min step size for volume

        // Break if too far
        if(t > 40.0) break;
    }

    // Tone mapping and vignetting
    col = col / (1.0 + col); // Simple Reinhard tone mapping
    col = pow(col, vec3(0.4545)); // Gamma correction
    col *= 1.0 - length(uv) * 0.5; // Vignette

    gl_FragColor = vec4(col, 1.0);
}

