in vec2 vUv;
out vec4 fragColor;

uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;

// --- Helper Functions ---

// 2D Rotation matrix
mat2 rot(float a) {
    float s = sin(a);
    float c = cos(a);
    return mat2(c, -s, s, c);
}

// Optimized palette function
vec3 palette(float t) {
    vec3 a = vec3(0.5, 0.5, 0.5);
    vec3 b = vec3(0.5, 0.5, 0.5);
    vec3 c = vec3(1.0, 1.0, 1.0);
    vec3 d = vec3(0.26, 0.41, 0.55);
    return a + b * cos(6.28318 * (c * t + d));
}

// Signed Distance Function for a box
float sdBox(vec3 p, vec3 b) {
    vec3 q = abs(p) - b;
    return length(max(q, 0.0)) + min(max(q.x, max(q.y, q.z)), 0.0);
}

// Scene mapping function using KIFS (Kaleidoscopic Iterated Function System)
float map(vec3 p) {
    // Move the tunnel forward
    p.z += iTime * 0.6;

    // Twist the space along Z axis for a vortex effect
    p.xy *= rot(p.z * 0.12 + iTime * 0.1);

    // Infinite repetition segments
    float zCell = floor(p.z / 3.0);
    p.z = mod(p.z, 3.0) - 1.5;

    float d = 1e10;
    float s = 1.0;

    // Fractal Iterations
    for(int i = 0; i < 5; i++) {
        // Fold space to create fractal symmetry
        p = abs(p) - vec3(0.5, 0.5, 0.5) * s;

        // Dynamic rotations for complex crystal geometry
        p.xy *= rot(1.1 + float(i) * 0.1);
        p.xz *= rot(0.7);

        // Define a primitive box at the current scale
        float box = sdBox(p, vec3(0.18, 0.04, 0.18) * s);

        // Use smooth minimum for organic transitions or standard min for sharp edges
        d = min(d, box);

        // Scale down for the next iteration
        s *= 0.75;
    }

    return d;
}

void main() {
    // Fragment coordinates centered and normalized
    vec2 uv = (gl_FragCoord.xy * 2.0 - iResolution.xy) / min(iResolution.x, iResolution.y);

    // Camera setup
    vec3 ro = vec3(0.0, 0.0, -2.5); // Ray origin
    vec3 rd = normalize(vec3(uv, 1.2)); // Ray direction

    // Mouse interaction for camera rotation
    vec2 mouse = (iMouse.xy / iResolution.xy) * 2.0 - 1.0;
    if(iMouse.z <= 0.0) mouse = vec2(0.0); // Reset if no click if preferred

    rd.yz *= rot(mouse.y * 1.0);
    rd.xz *= rot(mouse.x * 1.0);

    // Raymarching variables
    float t = 0.0;        
    vec3 finalCol = vec3(0.0);

    // Optimization: d is used inside the loop
    float d;

    // Volumetric Glow Accumulation
    // We march through the scene and accumulate "glow" based on proximity to SDF surfaces
    for(int i = 0; i < 90; i++) {
        vec3 p = ro + rd * t;
        d = map(p);

        // Core Logic: Accumulate glow based on inverse distance
        // Adding a small epsilon to prevent division by zero
        float glow = 0.012 / (0.008 + abs(d));

        // Dynamic color based on depth, position, and time
        vec3 glowColor = palette(length(p.xy) * 0.4 + p.z * 0.1 + iTime * 0.15);

        // Distance-based attenuation (fade out in the distance)
        float mask = pow(smoothstep(40.0, 0.0, t), 2.0);

        finalCol += glow * glowColor * 0.04 * mask;

        // March the ray forward
        // We use a slightly smaller step (0.5 multiplier) to improve volumetric detail
        t += max(abs(d) * 0.5, 0.01);

        if(t > 40.0) break;
    }

    // Cinematic Post-Processing

    // Tone mapping (Reinhard-esque) to keep colors in range
    finalCol = finalCol / (1.0 + finalCol);

    // Gamma correction
    finalCol = pow(finalCol, vec3(0.4545));

    // Vignette effect
    float vignette = smoothstep(2.0, 0.5, length(uv));
    finalCol *= vignette;

    // Contrast boost
    finalCol = smoothstep(0.0, 1.0, finalCol);

    fragColor = vec4(finalCol, 1.0);
}
